def main():
    post_data = get_post_data()
    people_features = {}
    for p in post_data:
        for name, s_feature in p:
            feature = s_feature.values()
            feature = np.array(list(feature), dtype=np.float32)
            people_features[name] = feature
    features = np.array(list(people_features.values()))
    
    temp_feature = features[1]
    fm = FeaturesManager()

    fm.single_insert(temp_feature, "temp")
    print(fm.peoples)

    fm.mult_insert(features, people_features.keys())
    print(fm.peoples)
    print(fm.shape)

    fm.delete_feature("temp")
    print(fm.peoples)
    print(fm.shape)

    name, score = fm.identify(temp_feature)
    print(score)
    print(name)

if __name__ == "__main__":
    main()

